import React from "react";
import { Link } from "react-router-dom";

function Logout(props) {
  return (
    <Link to="/" onClick={props.onLogout}>
      <div class="dropdown-menu dropdown-menu-right">Logout</div>
    </Link>
  );
}

export default Logout;
